import React from 'react'
import '../global_css/'

const poster = [
  "/Assets/Images/video-list-0.jpg"
]


class Video extends React.Component {
  render() {
    return (

      <video className="video__player" controls poster={poster} ></video>

    )
  }
}

export default Video
